B.GG=A.a(s(["Throughout the ages, man has been using architecture to bridge the gaps between physical obstacles, for the purpose of providing an easy passage. Most of these bridges are also regarded as landmarks and are a vital part of the infrastructures of regions around the world. Some have even become city icons because of their influence and engineering wonder. The Chapel Bridge is a 204 meter long bridge crossing the Reuss River in the city of Lucerne in Switzerland. It is the oldest wooden covered bridge in Europe, and one of Switzerland\u2019s main tourist attractions. The covered bridge, constructed in 1333, was designed to help protect the city of Lucerne from attacks. Inside the bridge are a series of paintings from the 17th century, depicting events from Luzerne\u2019s history. Much of the bridge, and the majority of these paintings, were destroyed in a 1993 fire, though it was quickly rebuilt.","Since time began, man yearned to take to the sky, like a bird in flight. Throughout early history, many schemes were tried, and as many failed. In 1782, however, the concept of a balloon was developed and ultimately proven. Throughout the decades that followed, the dream of flying through the sky became a reality, through the efforts of a group of daring men of science and vision. Joseph and Etienne Montgolfier, brothers, were the owners of an extensive paper manufacturing plant at Annonay in Avignon. In addition to their business, the pair shared an intense interest in navigating the sky. In 1782, the brothers came up with the idea of inflating a large paper vessel with heated air. Their experiment worked, and they successfully launched their device in November 1782. After making improvements to their design, the Montgolfier brothers constructed a new balloon filled with hydrogen. Amazed spectators watched as their balloon rose in the air to a height said to be beyond calculation.",'Malls are collections of independent retail stores and services conceived, constructed and maintained by a management firm. Occupants can include restaurants, banks, theaters, professional offices and even service stations. The first department store, Bloomingdale\'s was founded in 1872 by two brothers named Lyman and Joseph Bloomingdale. The store rode the popularity of the hoop skirt to great success and practically invented the department store concept at the beginning of the 20th century. John Wanamaker followed soon after with the opening of "The Grand Depot," a six-story round department store in Philadelphia in 1877. While Wanamaker modestly declined taking credit for "inventing" the department store, his store was definitely cutting edge. His innovations included the first white sale, modern price tags and the first in-store restaurant. He pioneered the use of money-back guarantees and newspaper ads to advertise his retail goods. Yet, some historians credit Young\'s shop with being the first department store, though most give the credit to John Wanamaker.','Writers and visionaries envisioned a world including robots in daily life. In 1818, Mary Shelley wrote "Frankenstein," which was about a frightening artificial lifeform come to life by a mad, but brilliant scientist, Dr. Frankenstein. Science fiction writer and futurist Isaac Asimov first used the word "robotics" in 1941 to describe the technology of robots and predicted the rise of a powerful robot industry. Asimov wrote "Runaround," a story about robots which contained the "Three Laws of Robotics," which centered around Artificial Intelligence ethics questions. Norbert Wiener published "Cybernetics," in 1948, which formed the basis of practical robotics, the principles of cybernetics based on artificial intelligence research. In 1954 George Devol invented the first digitally operated and a programmable robot called the Unimate. In 1956, Devol and his partner Joseph Engelberger formed the world\'s first robot company. In 1961, the first industrial robot, Unimate, went online in a General Motors automobile factory in New Jersey.',"Zeppelin was the name given to the dirigibles invented by the persistent Count Ferdinand von Zeppelin. The first rigid framed airship flew on November 3, 1897, and was designed by David Schwarz, a timber merchant. Its skeleton and outer cover were made of aluminum. Powered by a 12-horsepower Daimler gas engine connected to three propellers, it lifted off successfully in a tethered test at Templehof near Berlin, Germany, however, the airship crashed. In 1900, German military officer, Ferdinand Zeppelin invented a rigid framed dirigible that became known as the Zeppelin. Zeppelin flew the world's first untethered rigid airship, the LZ-1, on July 2, 1900, near Lake Constance in Germany, carrying five passengers. The cloth-covered dirigible had an aluminum structure, seventeen hydrogen cells, and two 15-horsepower Daimler internal combustion engines, each turning two propellers. During its first flight, it flew about 3.7 miles in 17 minutes and reached a height of 1,300 feet.",'The 16th century was a time of unprecedented change that saw the very beginning of the modern era of science, great exploration, religious and political turmoil, and extraordinary literature. In 1543, Copernicus published his theory that the earth was not the center of the universe, but rather, that the Earth and the other planets orbited around the sun. Called the Copernican Revolution, his theory forever changed astronomy, and ultimately changed all of science. During the 16th century, advancements were also made in the theories of mathematics, cosmography, geography, and natural history. In this century inventions related to the fields of engineering, mining, navigation, and the military arts were prominent. Renaissance artist and inventor Leonardo da Vinci began painting his "Mona Lisa" in 1503, and finished it three years later; in 1508, Michaelangelo began painting the ceiling of the Sistine Chapel in Rome. In 1510, Da Vinci designed the horizontal water wheel.','The word "Corinthian" describes an ornate column style developed in ancient Greece and classified as one of the Classical Orders of Architecture. The Corinthian style is more complex and elaborate than the earlier Doric and Ionic Orders. The capital or top part of a Corinthian style column has lavish ornamentation carved to resemble leaves and flowers. Roman architect Vitruvius described the Corinthian column as "an imitation of the slenderness of a maiden; for the outlines and limbs of maidens, being slender on account of their tender years, admit of prettier effects in the way of adornment." Because of their opulence, Corinthian columns are rarely used as common porch columns for the ordinary home. The style is more suited for Greek Revival mansions and public architecture such as government buildings, especially courthouses. The Temple of Olympian Zeus (175 B.C.) in Athens is said to have had more than 100 Corinthian columns.','Jean-Pierre Blanchard (1753-1809) designed a hydrogen balloon with flapping devices to control its flight. He moved to England, where he gathered a small group of enthusiasts, including Boston physician, John Jeffries. John Jeffries offered to pay for what became the first flight across the English Channel in 1785. John Jeffries later wrote that they sank so low crossing the English Channel that they threw everything overboard including most of their clothing, arriving safely on land "almost naked as the trees." The first real balloon flight in the United States did not occur until the Jean-Pierre Blanchard ascended from the yard of the Washington Prison in Philadelphia, Pennsylvania, on January 9, 1793. That day, President George Washington, the French ambassador, and a crowd of onlookers watched Jean Blanchard ascend to about 5,800 feet. Blanchard carried the first piece of airmail with him, a passport presented by President Washington that directed all citizens of the United States, that they help Mr. Blanchard in his efforts.',"Credit for the invention of the first practical parachute frequently goes to Sebastien Lenormand, who demonstrated the parachute principle in 1783. However, parachutes had been imagined and sketched by Leonardo Da Vinci centuries earlier. Before Sebastien Lenormand, other early inventors designed and tested parachutes. Croatian Faust Vrancic, for instance, constructed a device based on Da Vinci's drawing. To demonstrate it, Vrancic jumped from a Venice tower in 1617 wearing a rigid-framed parachute. Frenchman Jean Pierre Blanchard (1753-1809) was probably the first person to actually use a parachute for an emergency. In 1785, he dropped a dog in a basket in which a parachute was attached from a balloon high in the air. In 1793, Blanchard claimed to have escaped from a hot air balloon that exploded with a parachute. However, there were no witnesses. Blanchard, it should be noted, did develop the first foldable parachute made from silk. Up until that point, all parachutes were made with rigid frames.","During the mid-1500s, Italian inventor and artist Leonardo Da Vinci made drawings of a fantastical machine that might have flapped its wings like a bird and inspired the modern helicopter. The Russian-American aviation pioneer Igor Sikorsky is considered to be the \"father\" of helicopters, not because he was the first to invent it, but because he invented the first successful helicopter upon which further designs were based. One of aviation's greatest designers, Sikorsky began work on helicopters as early as 1910. By 1940, Sikorsky's successful VS-300 had become the model for all modern single-rotor helicopters. He also designed and built the first military helicopter, the XR-4, which he delivered to the U.S. Army in 1941. Sikorsky's helicopters had the control capabilities to fly safely forwards and backward, up and down and sideways. In 1958, Sikorsky's rotorcraft company made the world's first helicopter that could land and take off from the water; and floated on water as well."]),t.s)
